import React, { useState } from 'react';
import './app2.css';


function App() {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(false);

  const fetchUsers = async () => {
    console.log("Button Clicked - starting API call");

    setLoading(true);

    try {
      console.log("Fetching users from API...");
      const response = await fetch('http://localhost:5000/users');
      console.log("Response received:", response);
      const data = await response.json();
      console.log("Data From Backend:", data);
      setUsers(data);
      console.log("UI upadate with Users");
    }
    catch (error) {
      console.error("API Error:", error);
    }

    setLoading(false);
    console.log("Fetching process completed");
};

return (
  <div>
    <h1>User List</h1>
    <button onClick={fetchUsers} disabled={loading}>Show</button>
    {loading && <p>Loading...</p>}

    {users.map((user) => (
      <table>
        <tr>
          <th>No.</th>
          <th>Name</th>
          <th>Email</th>
          <th>Password</th>
        </tr>
        <tr>
          <td>{user.id}</td>
          <td>{user.name}</td>
          <td>{user.email}</td>
          <td>{user.password}</td>
        </tr>
      </table>
    ))}
  </div>
);  
}

export default App;
